import React, { Component } from "react";
import CourseGoal from "./components/Goal";
import "./App.css";
import goals from "./assets/reactjs.png";
import Header from "./components/Header";

class App extends Component {
  render() {
    return (
      <main>
        <Header image={{ src: goals, alt: "A List Of Goal" }} />
        <CourseGoal title="COURSE GOAL" description="DESCRIPTION">
          <p>123</p>
        </CourseGoal>
      </main>
    );
  }
}

export default App;
